  false,\n\t\"url\": null,\n\t\"notes\": \"The Horicon National Wildlife Refuge consists
  of 20,979 acres of which 15,573 acres is march and 5,406 acres is upland. The majority
  of the woodlots on the refuge are small averaging under 10 acres. The Refuge's management
  objectives include; to preserve and restore natural ecosystem species of animals
  and plants that are endangered or threatened, perpetuate the migratory bird resource,
  preserve natural diversity and abundance of mammals and non-migratory birds, and
  provide visitors with a high quality, safe, and enjoyable recreational experience
  oriented toward wildlife.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
